import React, { useState,useEffect } from "react";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  NavbarText
} from "reactstrap";

import * as ReactBootStrap from "react-bootstrap";
import Check from './images/Checking.png';

import Header from "./components/Header";

const Checking = props => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

const url= "/AccountHolders/{id}/DBACheckingAccounts";

  useEffect(() => {
    // Update the document title using the browser API

    fetch(url, {
      "method": "POST",
      "headers": {
        "content-type": "application/json",
        "Authorization" : `Bearer ${ localStorage.getItem("JWTToken")}`
        //"accept": "application/json"
      },
     // "body": JSON.stringify(), //data
    })






  },[]
  );

 




  const year = new Date().getFullYear;
  return (
    <div>
      <h1>Merit Banking Services</h1>
      <h2>Checking Accounts</h2>
     
     
    
      <ReactBootStrap.Nav.Link js-scroll-trigger a href="/account">
            Home
       </ReactBootStrap.Nav.Link>
      <ReactBootStrap.Nav.Link js-scroll-trigger a href="/deposit">
           Click here to Create Saving Account
            </ReactBootStrap.Nav.Link>

      <ReactBootStrap.Nav.Link js-scroll-trigger a href="/deposit">
           Click here to make Deposit
            </ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link js-scroll-trigger a href="/transfer">
            Click here to make Transfer
            </ReactBootStrap.Nav.Link>
         <ReactBootStrap.Nav.Link js-scroll-trigger a href="/account">
           Close Saving Account
        </ReactBootStrap.Nav.Link>   

      <form>
      <img src={Check}></img>
      </form>
         

    </div>
  );
};
  
export default Checking;
